import { exampleData } from "../Data/list";

export function BankBalanceLableUdate(){
    const newText = exampleData[exampleData.length-1].bankBalance
    document.getElementById("BankBalance").style.textContent = newText.toLocaleString('de-DE', {minimumFractionDigits: 2, maximumFractionDigits: 2, style: 'currency', currency: 'EUR'})
    console.log(newText.toLocaleString('de-DE', {minimumFractionDigits: 2, maximumFractionDigits: 2, style: 'currency', currency: 'EUR'}))
}
